    // A KPK bitbase index is an integer in [0, IndexMax] range
    //
    // Information is mapped in a way that minimizes the number of iterations:
    //
    // bit  0- 5: white king index
    // bit  6-11: black king index
    // bit    12: side to move 1 WHITE
    // bit 13-14: white pawn file (from FILE_H to FILE_E)
    // bit 15-17: white pawn RANK_7 - rank (from RANK_7 - RANK_7 to RANK_7 - RANK_2)
    internal fun index(whitetoMove: Boolean, blackKingIndex: Int, whiteKingIndex: Int, pawnIndex: Int): Int {
        return whiteKingIndex + (blackKingIndex shl 6) + //

                ((if (whitetoMove) 1 else 0) shl 12) + //

                (BitboardUtils.getFileOfIndex(pawnIndex) shl 13) + (RANK_7 - BitboardUtils.getRankOfIndex(pawnIndex) shl 15)
    }

    fun probe(whiteKingIndex: Int, whitePawnIndex: Int, blackKingIndex: Int, whiteToMove: Boolean): Boolean {
        val idx = index(whiteToMove, blackKingIndex, whiteKingIndex, whitePawnIndex)
        return bitbase[idx / 32] and (1 shl (idx and 0x1F)) != 0
    }

    fun probe(board: Board): Boolean {
        var whiteKingIndex = BitboardUtils.square2Index(board.kings and board.whites)
        var blackKingIndex = BitboardUtils.square2Index(board.kings and board.blacks)
        var pawnIndex = BitboardUtils.square2Index(board.pawns)
        var whiteToMove = board.turn

        // Pawn is black
        if (board.pawns and board.blacks != 0L) {
            // flip vertical and change colors
            val aux = whiteKingIndex
            whiteKingIndex = 63 - blackKingIndex
            blackKingIndex = 63 - aux
            pawnIndex = 63 - pawnIndex
            whiteToMove = !whiteToMove
        }
        if (BitboardUtils.getFileOfIndex(pawnIndex) > 3) {
            // flip horizontal
            whiteKingIndex = BitboardUtils.flipHorizontalIndex(whiteKingIndex)
            blackKingIndex = BitboardUtils.flipHorizontalIndex(blackKingIndex)
            pawnIndex = BitboardUtils.flipHorizontalIndex(pawnIndex)
        }

        return probe(whiteKingIndex, pawnIndex, blackKingIndex, whiteToMove)
    }

    companion object {
        private val logger = Logger.getLogger("KPKBitbase")


        internal val RANK_7 = 6
    }
